import Box from '@mui/material/Box';

const TruckAdd = () => {
  return (
    <div className="">            
      <Box sx={{ height: 150, width: '100%' }}>
        <h3>Add Truck</h3>
      </Box>
    </div>
  );
};

export default TruckAdd;
